  return (
    <>
      <div className="top h-top">
        <div
          onClick={() => props.setView('project-name')}
          className="top-home cursor-pointer"
        >
          <i className="fas fa-home"></i>
        </div>
        <div
          onClick={(e) => setIsProjectNameChanging(true)}
          className="top-title cursor-text"
        >
          {props.projectName}
